request.description:
Create access token

Example usage:

    {
        "username": "your_username",
        "password": "your_password"
    }

Output:

    {
        "access_token": "eyJxxxxxxxx"
        "token_type": "bearer"
    }

Verify access token

Example usage:

    {
        "access_token": "eyJxxxxxxxx"
        "token_type": "bearer"
    }

Output:

    {
        "status": "success",
        "message": "Token is valid"
    }

Get my transactions

Output:

    {
        "status": "success",
        "message": "Transactions retrieved successfully",
        "data": [
            {
                "amount": 1000.0,
                "description": "your_description",
                "timestamp": "2021-05-30T00:00:00",
                "from_account_id": 1,
                "to_account_id": 2
            }
        ]
    }

Get my accounts

Output:

    {
        "status": "success",
        "message": "Accounts retrieved successfully",
        "data": [
            {
                "account_number": "your_account_number",
                "balance": 0.0,
                "user_id": 1
            }
        ]
    }
